import Home from "./components/Home";
import Header from "./components/Header";
import ProductsState from './components/context/products/ProductsState'
import CartState from './components/context/cart/CartState'
import "./App.css";

function App() {
  return (
    <ProductsState>
    <CartState>
    <div className="App">
      <div className="block">
          <Header />
          <Home />
      </div>
    </div>
    </CartState>
    </ProductsState>
  );
}

export default App;
